import Axios from "axios"
import { DEPOSIT_ADD_ITEM } from "../constants/depositConstants.js";

const addToDeposit = (puppyId, stats) => async (dispatch) => {

    try{
     const {data} = await Axios.get("/api/puppies/" + puppyId);
    dispatch({
    type: DEPOSIT_ADD_ITEM, payload:{
        puppy: data._id,
        name: data.name,
        image: data.image,
        price: data.price,
        stats: data.stats
    }});
    } catch (error) {
    }
}
export {addToDeposit};
